export default function Loading() {
    return (
        <div className="w-screen h-screen flex items-center justify-center bg-[#2a2a2a]">
            <div class="lds-roller"><div></div><div></div><div></div><div></div><div></div><div></div><div></div><div></div></div>
        </div>
    );
}
